import React from 'react';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Dialogs} from "./components/profileContentComponents/Dialogs/Dialogs";
import {ProfileContent} from "./components/profileContentComponents/Profile/ProfileContent";
import {NavBar} from "./components/Navbar/NavBar";
import {Header} from "./components/Header/Header";





function App () {

    const posts = [
        {name: 'Oldos', messagePost: 'Hi! Like my post!', count: 1},
        {name: 'Ariel', messagePost: 'Like my post!', count: 15},
        {name: 'Inga', messagePost: 'Hi! Like my!', count: 22},
        {name: 'Mara', messagePost: 'Like!', count: 2},
    ]

    const MyPosts = posts

    return (
        <BrowserRouter>
            <div className="app-wrapper">
                <Header/>
                <NavBar/>
                <div className="app-wrapper-content">
                    <Routes>
                        <Route path={'PROFILE'} element={<ProfileContent/>}/>
                        <Route path={'DIALOGS/:DIALOG?'} element={<Dialogs/>}/>



                        {/*<Route path={'NEWS'} element={<News/>}/>*/}
                        {/*<Route path={'MUSIC'} element={<Music/>}/>*/}
                        {/*<Route path={'SETTINGS'} element={<Settings/>}/>*/}
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );

}


export default App;
